import Header from './header';
import { Container } from '@material-ui/core';

export default function Layout(props) {
  return (
    <div>
      <Header></Header>
      <div>
        <Container maxWidth="sm">
          <Typography
            component="div"
            style={{ backgroundColor: '#cfe8fc', height: '100vh' }}
          >
            {props.children}
          </Typography>
        </Container>
      </div>
    </div>
  );
}
